script: |
  super -f text -I q5650.spq | sort > q5650.out

inputs:
  - name: q5650.spq
    data: |
      SELECT + - 59 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE - ( - + 0 ) / - 12 * + + 84 + + col0 + + col1 * 99 * col0 IS NOT NULL;
  - name: tab1

outputs:
  - name: q5650.out
    data: |
      -59
      -59
      -59
